import React from "react";

const Review_Post_Box = () =>{

    return <React.Fragment>

        
        <div
        style={{
            width: 'inherit',
            height: 'fit-content',

            border: 'black solid 2.5px',
            borderBottom: 'black solid 6px',

            borderRadius: '15px',
            padding: '2vh 5vw',

            fontSize: '20px'

        }}
        >

            <div
            style={{
                width:'30vw',
                aspectRatio: '1',

                display:'grid',
                justifyContent: 'center',
                alignItems:"center",

                border: 'black solid 2px',
                borderRadius: '15px',

                paddingBottom: '1vh',
                
                fontSize: '11vw'
            }}
            >+
            </div>

            <textarea
            style={{
                height:'20vh',

                marginTop: '3vh',
                fontSize: '15px',

                padding: `2vh 4vw`,

                border: 'black solid 2px',
                borderRadius: '15px'
            }}
            >

            </textarea>
        


        </div>
        

    </React.Fragment>

}

export default Review_Post_Box;
